import React, { useRef, useEffect, useState } from "react";
import Webcam from "react-webcam";
import * as faceapi from "face-api.js";

const AttendanceScannerUI = () => {
  const webcamRef = useRef(null);
  const [modelsLoaded, setModelsLoaded] = useState(false);
  const [message, setMessage] = useState("Initializing...");
  const [showThankYou, setShowThankYou] = useState(false);
  const [scannerAnimation, setScannerAnimation] = useState(false);

  // ---- Static users with base64 images ----
  const staticUsers = [
    {
      email: "john@example.com",
      base64: "data:image/jpeg;base64," 
    },
    // {
    //   email: "jane@example.com",
    //   base64: "data:image/png;base64,"
    //  },
  ];

  const registeredDescriptorsRef = useRef([]);
  const attendanceLogRef = useRef({});

  // Load face-api models
  useEffect(() => {
    const MODEL_URL = "/models";

    const loadModels = async () => {
      await faceapi.nets.ssdMobilenetv1.loadFromUri(MODEL_URL);
      await faceapi.nets.faceLandmark68Net.loadFromUri(MODEL_URL);
      await faceapi.nets.faceRecognitionNet.loadFromUri(MODEL_URL);
      setModelsLoaded(true);
      setMessage("Models loaded. Place your face inside the scanner.");
    };

    loadModels();
  }, []);

  // Load static user descriptors
  useEffect(() => {
    if (!modelsLoaded) return;

    const loadDescriptors = async () => {
      const labeledDescriptors = [];

      for (let user of staticUsers) {
        const img = await faceapi.fetchImage(user.base64);
        const detection = await faceapi
        .detectSingleFace(img)
        .withFaceLandmarks()
        .withFaceDescriptor();

        if (detection) {
        labeledDescriptors.push(
            new faceapi.LabeledFaceDescriptors(user.email, [detection.descriptor])
        );
        } else {
        console.warn(` No face found in static image for ${user.email}`);
}
      }

      registeredDescriptorsRef.current = labeledDescriptors;
      console.log(" Static descriptors loaded");
    };

    loadDescriptors();
  }, [modelsLoaded]);

  // Face detection loop
  useEffect(() => {
    if (!modelsLoaded) return;

    const interval = setInterval(async () => {
      if (!webcamRef.current) return;
      const video = webcamRef.current.video;
      if (!video) return;

      const detections = await faceapi
        .detectAllFaces(video)
        .withFaceLandmarks()
        .withFaceDescriptors();

      if (detections.length === 0) {
        setMessage("No face detected");
        setScannerAnimation(false);
        return;
      }

      if (detections.length > 1) {
        setMessage(" Multiple faces detected! Only one person allowed.");
        setScannerAnimation(false);
        return;
      }

      setScannerAnimation(true);

      const faceMatcher = new faceapi.FaceMatcher(
        registeredDescriptorsRef.current,
        0.6
      );
      const bestMatch = faceMatcher.findBestMatch(detections[0].descriptor);

      if (bestMatch.label !== "unknown"  && bestMatch.distance < 0.6) {
        if (!attendanceLogRef.current[bestMatch.label]) {
          attendanceLogRef.current[bestMatch.label] = "check-in";
        } else {
          attendanceLogRef.current[bestMatch.label] = "check-out";
        }

        setMessage(` ${bestMatch.label} checked in!`);
        setShowThankYou(true);

        // Auto return to scanner after 5 seconds
        setTimeout(() => {
          setShowThankYou(false);
          setMessage("Place your face inside the scanner.");
          setScannerAnimation(false);
        }, 5000);
      } else {
        setMessage(" Face not recognized!");
        setScannerAnimation(false);
      }
    }, 1500);

    return () => clearInterval(interval);
  }, [modelsLoaded]);

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-900 p-4 text-white">
      {!showThankYou ? (
        <div className="relative">
          <h1 className="text-2xl font-bold mb-4 text-center">Face Attendance Scanner</h1>

          <div className="relative w-96 h-72">
            <Webcam
              ref={webcamRef}
              mirrored
              screenshotFormat="image/jpeg"
              videoConstraints={{ facingMode: "user" }}
              className="rounded-lg border-4 border-indigo-400 shadow-lg w-full h-full object-cover"
            />

            {/* Scanner overlay */}
            <div className="absolute top-0 left-0 w-full h-full pointer-events-none">
              <div
                className={`absolute top-0 left-0 w-full h-1 border-t-4 border-green-400 animate-slide`}
                style={{ display: scannerAnimation ? "block" : "none" }}
              />
            </div>
          </div>

          <p className="mt-4 text-lg font-semibold text-center">{message}</p>
        </div>
      ) : (
        <div className="flex flex-col items-center justify-center">
          <h1 className="text-4xl font-bold mb-4 text-green-400">Thank You! </h1>
          <p className="text-xl font-semibold">Your attendance has been recorded.</p>
        </div>
      )}

      {/* Scanner animation */}
      <style>
        {`
          @keyframes slide {
            0% { top: 0; }
            50% { top: calc(100% - 4px); }
            100% { top: 0; }
          }
          .animate-slide {
            animation: slide 2s linear infinite;
          }
        `}
      </style>
    </div>
  );
};

export default AttendanceScannerUI;
